      localB->Compare = (uint8_T)(localP->AlphaBetaZerotodq0_Alignment ==
        localP->CompareToConstant_const);

      /* RelationalOperator: '<S386>/Compare' incorporates:
       *  Constant: '<S383>/Constant'
       *  Constant: '<S386>/Constant'
       */
      localB->Compare_i = (uint8_T)(localP->AlphaBetaZerotodq0_Alignment ==
        localP->CompareToConstant1_const);
