      if (instantDelay > (localP->VariableTransportDelay_MaxDelay)) {
        instantDelay = (localP->VariableTransportDelay_MaxDelay);
      }

      if (instantDelay < 0.0) {
        localXdot->VariableTransportDelay_CSTATE_o = 0;
      } else {
        localXdot->VariableTransportDelay_CSTATE_o = 1.0/instantDelay;
      }
